import React from 'react';
import Vehicle from './Vehicle';


const Peopleinfo = ({ name, birth_year, height, mass, cars }) => {
    return (
        <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5 pa4">
            <h5>{name}</h5>
            <p>{birth_year}</p>
            <p>{height}</p>
            <p>{mass}</p>
            <ul>{
                cars.map((cars, i) => {
                    return (
                        <Vehicle
                            key={i}
                            name={`Name: ${cars[i].name}`}
                            model={`Model: ${cars[i].model}`}
                            vehicle_class={`Vehicle Class: ${cars[i].vehicle_class}`}
                            passengers={`Passengers: ${cars[i].passengers}`}
                        />
                    );
                })}</ul>
        </div>  
    );
}

export default Peopleinfo;
